class Converter {

    /**
     * Given a base64 encoded string, this method converts it into binary content and save to given file.
     *
     * @param s
     * @param out
     */
    static public void fromBase64ToBinary(String s, File out) {
       byte[] decoded = Base64.decodeBase64(s)

       BufferedOutputStream writer = new BufferedOutputStream(new FileOutputStream(out))
       writer.write(decoded)
       writer.flush()
       writer.close()
    }


